import './style.css';

export default function ({ children }) {

    const buttonText = props.buttonText;
    const onButtonClick = props.onButtonClick;

    return (
        <button onClick={onButtonClick} className='action-button'>
            {buttonText}
            {children}
        </button>
    )
}
